import React from "react";
import { Typography } from "@material-ui/core";
import { Container, Row, Col, Button } from "react-bootstrap";

export function TopBanner(){
    return(
        <Container fluid>
            <Row className="justify-content-center">
                <Col xs lg="6">
                    <Typography >Financia el sueño de tu empresa</Typography>
                    <Typography>Nuestro modelo de riesgos evalúa en segundos una operación, lo que nos permite financiar en el mismo día.</Typography>
                    <Button>Empieza a financiarte</Button>
                </Col>
                <Col lg="6">
                </Col>
            </Row>
        </Container>
    )
}
